Rizin has modular architecture, thus adding support for a new architecture is very easy, if you are fluent in C. For various reasons it might be easier to implement it out of the tree. For this we will need to create single C file, called asm_mycpu.c and makefile for it. The key thing of RzAsm plugin is a structure RzAsmPlugin rz_asm_plugin_mycpu = { .name = "mycpu", .license = "LGPL3", .desc = "MYCPU disassembly plugin", .arch = "mycpu", .bits = 32, .endian = RZ_SYS_ENDIAN_LITTLE, .disassemble = &disassemble
}; where .disassemble is a pointer to disassembly function, which accepts the bytes buffer and length: static int disassemble(RzAsm *a, RzAsmOp *op, const ut8 *buf, int len) Makefile NAME=asm_snes
RZ_PLUGIN_PATH=$(shell rizin -H RZ_USER_PLUGINS)
LIBEXT=$(shell rizin -H LIBEXT)
CFLAGS=-g -fPIC $(shell pkg-config --cflags rz_analyss)
LDFLAGS=-shared $(shell pkg-config --libs rz_analysis)
OBJS=$(NAME).o
LIB=$(NAME).$(LIBEXT) all: $(LIB) clean: rm -f $(LIB) $(OBJS) $(LIB): $(OBJS) $(CC) $(CFLAGS) $(LDFLAGS) $(OBJS) -o $(LIB) install: cp -f asm_mycpu.$(SO_EXT) $(RZ_PLUGIN_PATH) uninstall: rm -f $(RZ_PLUGIN_PATH)/asm_mycpu.$(SO_EXT) asm_mycpu.c /* rizin - LGPL - Copyright 2018 - user */ #include <stdio.h>
#include <string.h>
#include <rz_types.h>
#include <rz_lib.h>
#include <rz_asm.h> static int disassemble(RzAsm *a, RzAsmOp *op, const ut8 *buf, int len) { struct op_cmd cmd = { .instr = "", .operands = "" }; if (len < 2) return -1; int ret = decode_opcode (buf, len, &cmd); if (ret > 0) { snprintf (op->buf_asm, rz_asm_BUFSIZE, "%s %s", cmd.instr, cmd.operands); } return op->size = ret;
} RzAsmPlugin rz_asm_plugin_mycpu = { .name = "mycpu", .license = "LGPL3", .desc = "MYCPU disassembly plugin", .arch = "mycpu", .bits = 32, .endian = RZ_SYS_ENDIAN_LITTLE, .disassemble = &disassemble
}; #ifndef RZ_PLUGIN_INCORE
RZ_API RzLibStruct rizin_plugin = { .type = RZ_LIB_TYPE_ASM, .data = &rz_asm_plugin_mycpu, .version = RZ_VERSION
};
#endif After compiling rizin will list this plugin in the output: _d__ _8_32 mycpu LGPL3 MYCPU

